import React from 'react';
import logo from './assets/airelogic_logo.svg';
import './App.css';
import NewBugDialog from './components/new_bug'
import NewUserDialog from './components/new_user'
import AllBugsDialog from './components/all_bugs'
import Box from '@mui/material/Box';


function App() {
  return (
    <div className="App" style={{width: '100vw'}}>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Box component="div" sx={{ display: 'inline', width: '100vw' }}>
          <AllBugsDialog/>
          <NewBugDialog/>
          <NewUserDialog/>
        </Box>
    </div>

  );
}

export default App;
